        Axios.get('http://localhost:3001/read').then((response) => {
            console.log(response);
            setPokemons(response.data);
        })
    }, [])

    function charger(){
        {pokemons.slice(0,1).map((val, key) => (

            <div>
                {val.nom}
            </div>
        ))};
    }

    return (
        <div className="widget6">
            {charger()}

        </div>
    );



}
